import{_ as a}from"./chunks/forge_edit_bat_file.D5cFGWHV.js";import{_ as t,c as o,o as s,at as r}from"./chunks/framework.DcKAIdBL.js";const i="/img/docs/faq/mcss_kill_java.png",n="/img/docs/faq/dialog_regedit_process_name.png",l="/img/docs/faq/dialog_performance_counters.png",h="/img/docs/faq/event_viewer.png",p="/img/docs/faq/utf8.png",y=JSON.parse('{"title":"FAQ","description":"Frequently asked questions and their answers","frontmatter":{"title":"FAQ","description":"Frequently asked questions and their answers"},"headers":[],"relativePath":"faq.md","filePath":"faq.md","lastUpdated":1749630207000}'),c={name:"faq.md"};function d(u,e,f,m,v,g){return s(),o("div",null,e[0]||(e[0]=[r('<h2 id="faq-unable-to-connect" tabindex="-1">Unable to connect to the server <a class="header-anchor" href="#faq-unable-to-connect" aria-label="Permalink to &quot;Unable to connect to the server {#faq-unable-to-connect}&quot;">​</a></h2><p>See the following <a href="/networking/troubleshooting">troubleshooting guide</a>.</p><h2 id="faq-error-initialization-vm" tabindex="-1">Error occurred during initialization of VM : Could not reserve enough space <a class="header-anchor" href="#faq-error-initialization-vm" aria-label="Permalink to &quot;Error occurred during initialization of VM : Could not reserve enough space {#faq-error-initialization-vm}&quot;">​</a></h2><p>You are likely using the 32bit version of Java. You need the 64bit version. It&#39;s either not installed or needs reinstalling.</p><p>To check which version you are currently using, open a command prompt and type <code>java -version</code></p><p>If you see 32-bit or an error, you need a new version of Java.</p><div class="info custom-block"><p class="custom-block-title">Choosing a Java Version</p><p>Depending on what server type / version you need a specific java version. Refer to our <a href="/advanced/java-version">Java Guide</a> to see which version you need. Download links are also listed.</p></div><h2 id="faq-failed-bind-port" tabindex="-1">Failed To Bind to Port <a class="header-anchor" href="#faq-failed-bind-port" aria-label="Permalink to &quot;Failed To Bind to Port {#faq-failed-bind-port}&quot;">​</a></h2><p>Try killing all java processes (refer to <a href="#faq-crash">regain-control</a>) and start your server again.</p><p>If you added an IP to the &#39;server-ip&#39; field in the server.properties file make sure to remove it. If you&#39;re running multiple servers make sure they&#39;re not using the same port. If you&#39;re still getting this error restarting your computer will usually resolve it.</p><h2 id="faq-file-locked" tabindex="-1">The process cannot access the file because another process has locked a portion of the file <a class="header-anchor" href="#faq-file-locked" aria-label="Permalink to &quot;The process cannot access the file because another process has locked a portion of the file {#faq-file-locked}&quot;">​</a></h2><p>This error happens when the server is already started in the background, but not visible in mcss. You have to stop the server, then start it again in mcss. To do that, follow <a href="#faq-crash">these steps</a>, then start the server again in mcss.</p><h2 id="faq-trouble-starting-server" tabindex="-1">Trouble starting a server <a class="header-anchor" href="#faq-trouble-starting-server" aria-label="Permalink to &quot;Trouble starting a server {#faq-trouble-starting-server}&quot;">​</a></h2><h3 id="faq-console-empty" tabindex="-1">The console remains empty and the server does nothing <a class="header-anchor" href="#faq-console-empty" aria-label="Permalink to &quot;The console remains empty and the server does nothing {#faq-console-empty}&quot;">​</a></h3><p>You either don&#39;t have Java installed or MCSS doesn&#39;t know where it is.</p><p>Make sure you have installed the correct version by following <a href="/advanced/java-version">this guide</a>.</p><p>If you know you have the correct version already installed, follow <a href="/advanced/java-path-update">this guide</a> to tell MCSS where to look for it.</p><h3 id="faq-server-error" tabindex="-1">The console does something, but the server fails to start <a class="header-anchor" href="#faq-server-error" aria-label="Permalink to &quot;The console does something, but the server fails to start {#faq-server-error}&quot;">​</a></h3><p>Read the error. More often than not, Minecraft throws easy to read errors that tell you exactly what went wrong. The answer to your issue could be even be in this FAQ !</p><h2 id="faq-console-commands-fail" tabindex="-1">The server works but when sending commands to the console nothing happens/The dashboard buttons don&#39;t work <a class="header-anchor" href="#faq-console-commands-fail" aria-label="Permalink to &quot;The server works but when sending commands to the console nothing happens/The dashboard buttons don&#39;t work {#faq-console-commands-fail}&quot;">​</a></h2><p>Open your server&#39;s settings (cogwheel icon on the dashboard) and open the advanced tab. Depending on your server type, append the following paramater to the end of the Java Startup Line :</p><ul><li><p>For a bukkit-based server (Bukkit/Spigot/Paper on any other fork) use <code>--nojline</code>.</p></li><li><p>For Bungeecord and its forks (Waterfall) use <code>-Djline.terminal=jline.UnsupportedTerminal</code> instead.</p></li></ul><p>Make sure to have a space between the end of the line and the argument.</p><h2 id="error-unable-to-access-jarfile" tabindex="-1">Error: unable to access jarfile <a class="header-anchor" href="#error-unable-to-access-jarfile" aria-label="Permalink to &quot;Error: unable to access jarfile&quot;">​</a></h2><p><strong>If this issue happens on a newly created server</strong>, it usually means the name of your server&#39;s JAR doesn&#39;t match with that in the startup flags.</p><p>Try to re-create the server. If the issue persists, join our discord server and we&#39;ll guide you through the steps to solve your issue. Alternatively if you know what you&#39;re doing you can edit the startup flags and the JAR&#39;s name to make them match</p><p><strong>If this issue occurs on an existing, working server</strong>, it means the JAR is being used somewhere else. The first fix would be to kill all java processes (through MCSS or task manager). If that doesn&#39;t work, restart your computer.</p><h2 id="faq-unsupported-servers" tabindex="-1">Can I create a Neoforge/Quilt/any other &quot;unsupported&quot; server ? <a class="header-anchor" href="#faq-unsupported-servers" aria-label="Permalink to &quot;Can I create a Neoforge/Quilt/any other &quot;unsupported&quot; server ? {#faq-unsupported-servers}&quot;">​</a></h2><p>Yes, in fact MCSS can run almost any server type, the differences between server types in the app are mostly visual.</p><p>As long as your server is a jar, you should be able to run it with MCSS, just select the &quot;closest&quot; server type (Use Forge for Neoforge for example).</p><h2 id="faq-crash" tabindex="-1">How do I regain control of my server if MCSS crashes? <a class="header-anchor" href="#faq-crash" aria-label="Permalink to &quot;How do I regain control of my server if MCSS crashes? {#faq-crash}&quot;">​</a></h2><p>To regain control of your servers you need to stop the servers. The easiest and safest way to do this is to join each server as an operator and type <code>/stop</code>, then restart them using MCSS.</p><p>If you can&#39;t, you have to kill all Java processes, to do this you go to &quot;Quick Options&quot; &gt; &quot;Kill all Java processes&quot; in the app.</p><p><img src="'+i+'" alt="Screenshot of the Kill all java processes option"></p><div class="danger custom-block"><p class="custom-block-title">danger</p><p>This will kill ALL Java processes, not only MCSS hosted Minecraft servers.</p><p>This includes:</p><ul><li>The game itself</li><li>Any other program running Java or relying on Java to function</li></ul><p>Also, you might experience loss of recent activity if the map wasn&#39;t saved recently.</p><p>Always prefer a proper stop to killing the server when possible!</p></div><h2 id="faq-mac-linux-support" tabindex="-1">Is there a Mac or Linux version? <a class="header-anchor" href="#faq-mac-linux-support" aria-label="Permalink to &quot;Is there a Mac or Linux version? {#faq-mac-linux-support}&quot;">​</a></h2><p>MCSS is currently only available on Windows.</p><h2 id="faq-24-7" tabindex="-1">Is this 24/7? <a class="header-anchor" href="#faq-24-7" aria-label="Permalink to &quot;Is this 24/7? {#faq-24-7}&quot;">​</a></h2><p>MCSS runs on your computer. As long as it is online, the server is. So yes, if your computer in ON 24/7, the server can be too</p><h2 id="faq-remote-control" tabindex="-1">Is there a way to remote control MCSS ? <a class="header-anchor" href="#faq-remote-control" aria-label="Permalink to &quot;Is there a way to remote control MCSS ? {#faq-remote-control}&quot;">​</a></h2><p>MCSS comes with a web panel to manage your servers remotely. You can find more info about it <a href="/webpanel/getting-started">on this page</a>. Please note that the panel is still under development so not all features from the app are included. There is also a REST API available for developers, you can learn more about it <a href="/api/about">on this page</a>.</p><h2 id="faq-dashboard-stats-stuck" tabindex="-1">Dashboard graphs are stuck to 0% CPU and 1MB of RAM <a class="header-anchor" href="#faq-dashboard-stats-stuck" aria-label="Permalink to &quot;Dashboard graphs are stuck to 0% CPU and 1MB of RAM {#faq-dashboard-stats-stuck}&quot;">​</a></h2><h3 id="faq-stats-normal" tabindex="-1">On a server using a java startup line <a class="header-anchor" href="#faq-stats-normal" aria-label="Permalink to &quot;On a server using a java startup line {#faq-stats-normal}&quot;">​</a></h3><p>This issue happens with the latest versions of Java. It can easily be fixed by defining the path to your version of java.</p><p>To fix it, you have to specify the direct path to your java binaries in MCSS.</p><ol><li>open the <code>file &gt; options</code> menu</li><li>in the <code>Global Java path override</code> line, add the path to your java.exe (most often in <code>C:\\Program Files\\Java\\jdk-&lt;version&gt;\\bin\\java.exe</code>), or use the Path Picker</li><li>restart MCSS and try to start a server again, the graphs should display the correct information.</li></ol><p>You can also add a different Java path for some server if only one requires Java 11 or higher. To do this, stop the server, go to the servers tab and click view settings on the three dots. There, you will be able to set a local Java path, under the Advanced tab.</p><h3 id="faq-stats-bat" tabindex="-1">On a server using a .bat file <a class="header-anchor" href="#faq-stats-bat" aria-label="Permalink to &quot;On a server using a .bat file {#faq-stats-bat}&quot;">​</a></h3><p>If you&#39;re using a bat file to start your server (like on Forge 1.17+ servers), the process is different :</p><p>Open the server&#39;s settings, and click on the advanced tab, then click the pencil icon next to the bat file selector :</p><p><img src="'+a+`" alt="Edit bat"></p><p>In you bat file, replace <code>java</code> by your full path to java.exe, in quotes (you can use the path picker to find it).</p><h2 id="faq-dll-crash" tabindex="-1">MCSS crashes when opening console or player manager (v13 and above). <a class="header-anchor" href="#faq-dll-crash" aria-label="Permalink to &quot;MCSS crashes when opening console or player manager (v13 and above). {#faq-dll-crash}&quot;">​</a></h2><p>You get this error when opening the console, player manager or other text editor:</p><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">Exception Message</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">:</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> Could not load the Scintilla </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">module</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> at</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> the path &#39;C:\\Users\\Desktop\\AppData\\Local\\Temp\\Scintilla.NET\\5.1.5\\x86\\Scintilla.dll&#39;.</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">Exception TargetSite: System.Windows.Forms.CreateParams get_CreateParams()</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">Exception StackTrace: </span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at ScintillaNET.Scintilla.get_CreateParams()</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at System.Windows.Forms.Control..ctor(Boolean autoInstallSyncContext)</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at System.Windows.Forms.Control..ctor()</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at ScintillaNET.Scintilla..ctor()</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at McssMain.Controls.ScintillaEditor.ScintillaControl..ctor()</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">   at McssMain.Controls.ScintillaEditor.BasicTextEditor..ctor()</span></span></code></pre></div><p>This is because you are missing 2 dependencies.</p><ul><li>Microsoft Visual C++ 2015-2019 Redistributable (x64)</li><li>Microsoft Visual C++ 2015-2019 Redistributable (x86)</li></ul><table tabindex="0"><thead><tr><th>Architecture</th><th>Link</th><th>Notes</th></tr></thead><tbody><tr><td>X86</td><td><a href="https://aka.ms/vs/17/release/vc_redist.x86.exe" target="_blank" rel="noreferrer">https://aka.ms/vs/17/release/vc_redist.x86.exe</a></td><td>Permalink for latest supported x86 version</td></tr><tr><td>X64</td><td><a href="https://aka.ms/vs/17/release/vc_redist.x64.exe" target="_blank" rel="noreferrer">https://aka.ms/vs/17/release/vc_redist.x64.exe</a></td><td>Permalink for latest supported x64 &amp; ARM64 version</td></tr></tbody></table><p>Or if you rather download it from the Microsoft website: <a href="https://docs.microsoft.com/en-US/cpp/windows/latest-supported-vc-redist" target="_blank" rel="noreferrer">https://docs.microsoft.com/en-US/cpp/windows/latest-supported-vc-redist</a></p><blockquote><p>While mcss is currently built against x86 it might change in the future. So it&#39;s recommended to install both. A lot of applications require this, at some point your computer will have this installed anyway.</p></blockquote><h2 id="faq-process-name-format" tabindex="-1">Since v11.5.0 the process name requires a different format. <a class="header-anchor" href="#faq-process-name-format" aria-label="Permalink to &quot;Since v11.5.0 the process name requires a different format. {#faq-process-name-format}&quot;">​</a></h2><p><img src="`+n+'" alt="Screenshot of the process name requires different format dialog"></p><p>This change is required, click &#39;Yes&#39; to apply the change.</p><h2 id="faq-failed-performance-counters" tabindex="-1">Failed to set performance counters. <a class="header-anchor" href="#faq-failed-performance-counters" aria-label="Permalink to &quot;Failed to set performance counters. {#faq-failed-performance-counters}&quot;">​</a></h2><p><img src="'+l+'" alt="Screenshot of failed to set performance counters dialog"></p><p>Your performance counters are corrupt. MCSS can automatically do this for you. Click &quot;Yes&quot; to fix it.</p><p>In case you want to do this manually:</p><p>Open a command prompt with administrator rights and execute the following commands:</p><div class="language-cmd vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">cmd</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">cd c:\\windows\\system32`</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">lodctr /R`</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">if</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> the lodctr command fails, simply run it again)</span></span></code></pre></div><blockquote><p>More info: <a href="https://support.microsoft.com/en-us/help/300956/how-to-manually-rebuild-performance-counter-library-values" target="_blank" rel="noreferrer">Microsoft Support | How to manually rebuild Performance Counter Library values</a></p></blockquote><h2 id="faq-ipv6" tabindex="-1">I have this weird long IP address, is this normal? <a class="header-anchor" href="#faq-ipv6" aria-label="Permalink to &quot;I have this weird long IP address, is this normal? {#faq-ipv6}&quot;">​</a></h2><p>Yes that is completely normal, that is called an IPv6 address. Most people don&#39;t have access to IPv6 yet so it&#39;s smart to share your IPv4 address instead.</p><p>There are 2 versions of the IP protocol.</p><ul><li>IPv4: 192.x.x.x</li><li>IPv6: 2001:0db8:85a3:0000:0000:8a2e:0370:7334</li></ul><p><a href="https://www.networkworld.com/article/3254575/what-is-ipv6-and-why-aren-t-we-there-yet.html" target="_blank" rel="noreferrer">More info about IPv6</a></p><div class="info custom-block"><p class="custom-block-title">IPv6 doesn&#39;t need port forwarding</p><p>IPv6 doesn&#39;t require port forwarding. With IPv4 you have a private and public IP. This is not the case with IPv6, because there are plenty of addresses to hand out. So each computer gets its own public address.</p></div><h2 id="faq-mcss-crashed-help-out" tabindex="-1">MCSS has crashed and I want to help fix it. <a class="header-anchor" href="#faq-mcss-crashed-help-out" aria-label="Permalink to &quot;MCSS has crashed and I want to help fix it. {#faq-mcss-crashed-help-out}&quot;">​</a></h2><p>To help fix it, you can upload your Windows event logs and MCSS logs. <em>(please zip all the files and send them to me by email, SpigotMC or Discord)</em></p><p>To get the MCSS logs:</p><ul><li>MCSS logs can be found in the MCSS folder under /logs</li></ul><p>To get the Windows event logs:</p><ul><li>Go to start and type eventvwr</li></ul><p>You can follow the other steps on screenshot below.</p><p><img src="'+h+'" alt="Screenshot of the event viewer"></p><h2 id="faq-utf8" tabindex="-1">The UTF-8 encoding doesn&#39;t work, I <em>really really</em> need it to work. <a class="header-anchor" href="#faq-utf8" aria-label="Permalink to &quot;The UTF-8 encoding doesn&#39;t work, I *really really* need it to work. {#faq-utf8}&quot;">​</a></h2><p>The sad reality is that UTF-8 is a second-class citizen in Windows.</p><p>As of Windows 10 version 1903, you have the option to set the system locale (language for non-Unicode programs) to UTF-8, but the feature is in beta.</p><p>To activate it:</p><ul><li>Run <code>intl.cpl</code> (which opens the regional settings in Control Panel)</li><li>Follow the instructions in the screen shot below.</li></ul><p><img src="'+p+'" alt="Screenshot of the region settings window as part of the control panel"></p><p>In some cases, the server needs to be started with additional parameters. E.g <code>-Dfile.encoding=UTF-8</code>, this varies from the server type used. More research is required on your end.</p><p>After setting this all up, this still doesn&#39;t guarantee that it will work. This just shows how bad the UTF-8 console support in Windows really is.</p><p>(sources)</p><ul><li><a href="https://stackoverflow.com/a/57134096" target="_blank" rel="noreferrer">https://stackoverflow.com/a/57134096</a></li><li><a href="https://books.google.be/books?id=tkFPDwAAQBAJ&amp;pg=PA436&amp;lpg=PA436&amp;dq=UTF-8+is+a+second-class+citizen+in+Windows&amp;source=bl&amp;ots=E9LdoNrGie&amp;sig=ACfU3U0CaOrY_k5aj-tZ8xri76hgEAZ5Vw&amp;hl=en&amp;sa=X&amp;ved=2ahUKEwja_vj00-DoAhVFDuwKHdBjAiwQ6AEwAHoECAsQKQ" target="_blank" rel="noreferrer">https://books.google.be/books?id=tkFPDwAAQBAJ&amp;pg=PA436&amp;lpg=PA436&amp;dq=UTF-8+is+a+second-class+citizen+in+Windows&amp;source=bl&amp;ots=E9LdoNrGie&amp;sig=ACfU3U0CaOrY_k5aj-tZ8xri76hgEAZ5Vw&amp;hl=en&amp;sa=X&amp;ved=2ahUKEwja_vj00-DoAhVFDuwKHdBjAiwQ6AEwAHoECAsQKQ</a></li></ul>',94)]))}const q=t(c,[["render",d]]);export{y as __pageData,q as default};
